import React from "react";

function SettingImageWithAbsoultValue({
  imgUrl,
  top = top !== "auto" && `${top}px`,
  bottom = "auto",
  right = "auto",
  left = "auto",
}) {
  return (
    <div
      className=""
      style={{
        position: "absolute",
        top: `${top}px`,
        right: { right },
        left: { left },
        bottom: { bottom },
      }}
    >
      <img src={imgUrl} alt="#" />
    </div>
  );
}

export default SettingImageWithAbsoultValue;
